import React from 'react';
import './style.scss';
import {Navbar, Nav, NavItem, NavLink } from 'reactstrap';

import {FaHome, FaSearch, FaPeopleCarry, FaGithub} from 'react-icons/fa';

class Header extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div className="Footer">
      <Navbar color="light" light>
            <NavLink href="#"><FaHome/></NavLink>
            <NavLink href="#"><FaSearch/></NavLink>
            <NavLink href="#"><FaPeopleCarry/></NavLink>
            <NavLink href="https://github.com/m-hakkestad/ReactAPITest"><FaGithub/></NavLink>
      </Navbar>
      </div>
    )
  }
}
export default Header;
